import React from 'react'

import { BsTrash2 } from 'react-icons/bs';

export const LiNavBar = ({boolean, array, deleteFavorite}) => {
  if (boolean===true){
    array.map(item=>{
      return (
        <li className="li-Dropdown">
          <a className="dropdown-item pe-1" href="#">{item.name}</a>
          <BsTrash2 className="iconNavBar" onClick={deleteFavorite}/>
        </li>
      )
    })
    
  }
  return (
    <li className="li-Dropdown">
      <a className="dropdown-item pe-1" href="#">Empty</a>
    </li>
  )
}
